import Box from "./Box";
import styled from "styled-components";

const StyledBoardRow = styled.div``;

const BoardRow = () => {
  return (
    <StyledBoardRow>
      <Box boxId={1} />
      <Box boxId={2} />
      <Box boxId={3} />
    </StyledBoardRow>
  );
};

export default BoardRow;
